import React, { Component } from "react";
import '../styles/App.css';

import SearchBar from './SearchBar';

class App extends Component {
  render() {
    console.info('App render');
    return (
      <div className='App container' style={{ marginTop: '10px', backgroundColor: 'green' }}>
        <div className='row'>
          <div className='col'>
            검색 위치
            <div className='row'>
              <div className='col-8' style={{ backgroundColor: 'gray' }}>
                유튜브 플레이 위치
              </div>
              <div className='col-4' style={{ backgroundColor: 'blue' }}>
                검색 결과
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
